Defendant Giovannis G Rodriguez in court with attorney Danielle L. Shelton.  Defendant Giovannis G Rodriguez in custody.  James W. Frisch appeared for the State of Wisconsin.  Plea hearing proceeds.  Defendant was advised of constitutional rights and maximum penalties, and further advised that if not a United States citizen deportation is possible. Defendant sworn, examined as to plea, and entered a plea of guilty.  Court found defendant freely, voluntarily and intelligently waived all constitutional rights. Plea questionnaire waiver of rights and addendum to plea questionnaire received and filed. Parties stipulated to the criminal complaint as factual basis to sustain defendant's plea. Court found defendant guilty as charged in the Information and ordered a Judgment of Conviction be entered into the record.  The Court advised defendant that as a convicted felon not to possess any firearms or body armor. Court further advised defendant of voting ineligibility. 

Sentencing proceeded.  Statements by the State, defense and defendant.  Additional statements by: Mr. Julio R.  The Court imposed the following sentence:
Defendant's TOTAL LENGTH OF SENTENCE shall be 4 years.  Defendant's TERM OF CONFINEMENT in the Wisconsin Prison System shall be for 2 years  with credit for 78 days time served.  Defendant shall serve 2 years  on EXTENDED SUPERVISION.  The defendant is eligible for the Challenge Incarceration Program but not for the Wisconsin Substance Abuse Program.  The Court advised the defendant of his determinate sentence pursuant to statute and in accordance with Form CR-234.  Copy provided to defendant.  The Court STAYED THE SENTENCE and placed the defendant on probation to the State Department of Corrections for a period of 4 years.  
 * Court ordered defendant to provide a DNA sample.

CONDITIONS OF PROBATION (and Extended Supervision, if revoked):
 - No contact with Eduardo B. or Sebastian H.;
 - No controlled substances or alcohol;
 - AODA assessment and treatment;
 - Urine screens;
 - No contact with co-actors D.V.W. (2/16/98); D.G.A. (10/20/98); or R.A.S. (9/22/98);
 - Obtain high school diploma, HSED or GED;
 - Seek and maintain employment;
 - Be given job and vocational training;
 - Parenting classes/counseling;
 - Cognitive thinking intervention counseling;
 - Serve 6 months condition time, no good time, with release to the Day Reporting Center only;
 - Pay restitution to Sebastian H. in the amount of $260.00 first; then, pay the DNA surcharge, plus all applicable costs, surcharges and disbursements.  Should defendant get revoked, Court ordered all sums to be paid while in prison to be collected by the Department of Corrections from up to 25% of prison funds.  Balance would then be paid while on Extended Supervision.   Failure to pay amounts in full would result in a civil judgment entered against defendant.

